Descripcion:
MÁQUINAS Y APARATOS UTILIZADOS, EXCLUSIVA O PRINCIPALMENTE, PARA LA FABRICACIÓN DE SEMICONDUCTORES EN FORMA DE MONOCRISTALES PERIFORMES U OBLEAS (“WAFERS”), DISPOSITIVOS SEMICONDUCTORES, CIRCUITOS ELECTRÓNICOS INTEGRADOS O DISPOSITIVOS DE VISUALIZACIÓN
(“DISPLAY”) DE PANTALLA PLANA;
MÁQUINAS Y APARATOS DESCRITOS EN LA NOTA 11 C) DE ESTE CAPÍTULO; PARTES Y ACCESORIOS

